import {Card} from 'react-bootstrap';
import image from '../../../res/23619.jpeg';
const ItemTopLocations = () => {
  return (
    <Card
      style={{
        width: 200,
        height: 170,
        marginLeft: 2,
        marginRight: 2,
        display: 'inline-flex',
        flexDirection: 'column',
      }}
    >
      <img
        src={image}
        style={{width: 200, height: 130, backgroundColor: '#eeeeee'}}
      ></img>
      <strong style={{padding: 5}}>Location name</strong>
    </Card>
  );
};
export default ItemTopLocations;
